import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './components/Home/Home';
import SignIn from './components/SignIn/SignIn';
import SignUp from './components/SignUp/SignUp';
import ForgotPassword from './components/ForgotPassword/ForgotPassword';
import NewPassword from './components/NewPassword/NewPassword';
import Profile from './components/Profile/Profile';
import Main from './components/Main/Main';
import NotFound from './components/NotFound/NotFound';
import Footer from './components/Footer/Footer';
import './App.css';
import { useState } from 'react';

function App() {
  console.log(window.outerHeight)
console.log(document.querySelector('#root').clientHeight)

  const rootHeightPage = window.outerHeight > document.querySelector('#root').clientHeight ?
                     document.querySelector('#root').style.minHeight = '100%' :
                     document.querySelector('#root').style.height = '100%';

  const [rootHeight, setRootHeight] = useState(rootHeightPage)

  return (
    <BrowserRouter>

      <Switch>
        <Route exact path='/' component={Home} />
        <Route path='/SignUp' component={SignUp} />
        <Route path='/SignIn' component={SignIn} />
        <Route path='/ForgotPassword' component={ForgotPassword} />
        <Route path='/NewPassword' component={NewPassword} />
        <Route path='/Main' component={Main} />
        <Route path='/Profile' component={Profile} />
        <Route component={NotFound} />
      </Switch>

      <Footer/>
    </BrowserRouter>
  );
}

export default App;
